import { Pipe, PipeTransform } from '@angular/core';
import {DomSanitizer} from '@angular/platform-browser';

@Pipe({
  name: 'innerHtml'
})
export class InnerHtmlPipe implements PipeTransform {
	constructor(private sanitizer: DomSanitizer) {}

	transform(html) {
		return this.sanitizer.bypassSecurityTrustHtml(html);
	}

}

import {Pipe, PipeTransform} from '@angular/core';

@Pipe({
	name: 'progressValue',
	pure: true
})
export class ProgressValuePipe implements PipeTransform {

	transform(value: number, total: number, type: string): string {
		const _total = value > total ? value : total;

		const output = value > 0 ? Math.round(value * 100 / _total) : 0;
		switch (type) {
			case 'position':
				return `${output}%`;
			case 'transform':
				return output > 10 && output < 90 ? `translateX(-20px)` : output >= 90 ? `translateX(-100%)` : 'translateX(-10%)';
		}
	}

}

import { Pipe, PipeTransform } from '@angular/core';
import {TRating} from '../models/rating.model';

@Pipe({
  name: 'sortIndRating'
})
export class SortIndRatingPipe implements PipeTransform {

	ratingSortOrder: string;
	/**
	 * Takes a value and makes it lowercase.
	 */
	transform(array: any[], ratingSortOrder: string, dc: string): TRating[] {
		this.ratingSortOrder = ratingSortOrder;
		return this.sortRating(dc, array);
	}

	sortRating(dc, array): TRating[] {
		if(array.length === 0) {return [];}
		const total = array[array.length - 1];
		if (total.total) {
			array.pop();
		}
		array.sort((a, b) => {
			if (typeof a[dc] === 'number' || typeof a[dc] === 'string') {
				if (a[dc] > b[dc]) {return this.ratingSortOrder === 'asc' ? 1 : -1;}
				if (a[dc] < b[dc]) {return this.ratingSortOrder === 'asc' ? -1 : 1;}
				return 0;
			}
			if (a[dc].value > b[dc].value) {return this.ratingSortOrder === 'asc' ? 1 : -1;}
			if (a[dc].value < b[dc].value) {return this.ratingSortOrder === 'asc' ? -1 : 1;}
			return 0;
		});
		if (total.total) {
			array.push(total);
		}
		return array.map((item) => item.childs ? {...item, childs: this.sortRating(dc, item.childs)} : item);
	}

}

