import {Injectable} from '@angular/core';
import {WebApiService} from './web-api.service';
import {ApiModel} from '../models/api.model';
import {AppService} from './app.service';
import {tap} from 'rxjs/operators';
import {ActivatedRoute, Router} from '@angular/router';
import {TResponse} from '../models/response.model';
import {prepareFormData} from '../shared/utils/api.utils';
import {environment} from '../../environments/environment';

@Injectable({
	providedIn: 'root'
})
export class AuthService {

	constructor(
		private apiService: WebApiService,
		private appService: AppService,
		private route: ActivatedRoute,
		private router: Router
	) {
	}

	/**
	 * Проверяем токен при старте приложения,
	 * если токен действительный, то перенаправляем на страницу ввода пин кода
	 * если токен не действительный, то на страницу авторизации
	 */
	checkToken() {
		const userHash = localStorage.getItem('userHash');
		const user = localStorage.getItem('user');
		const token = localStorage.getItem('token');
		this.apiService
			.post$(ApiModel.checkToken, prepareFormData({user, userHash, token}))
			.pipe(tap((data: TResponse) => {
				if (!data.payload && environment.production) {
					this.router.navigate(['/auth/login'], {replaceUrl: true});
				}
			}))
			.subscribe();
	}

	/**
	 * Авторизация по логину и паролю
	 *
	 * @param authObject
	 */
	authByLoginPass(authObject: { p: string; l: string }) {
		this.apiService
			.get$(ApiModel.authByLoginPass, authObject)
			.pipe(tap((data: TResponse) => {
				if (data.status === 'OK') {
					localStorage.setItem('user', data.payload.userId);
					localStorage.setItem('authKey', data.payload.id);

					this.router.navigate(['/pin'], {replaceUrl: true});
				}
			}))
			.subscribe();
	}

	/**
	 * Авторизация по пин коду и вход в приложение
	 */
	login() {
		const authKey = localStorage.getItem('authKey');
		const reqData = {
			deviceUuid: null,
			u: authKey,
			o: null,
			r: undefined,
			v: '3.4.5',
		};
		return this.apiService.get$(ApiModel.pin, reqData);
	}
}

import { Injectable } from '@angular/core';
import {BehaviorSubject, Observable} from 'rxjs';
import {ToastController} from '@ionic/angular';

@Injectable({
  providedIn: 'root'
})
export class CrisisService {

	private filter$: BehaviorSubject<boolean> = new BehaviorSubject<boolean>(false);

	constructor(
		private toastCtrl: ToastController,
	) {
	}

	get filter() {
		return this.filter$ as Observable<boolean>;
	}

	get value() {
		return this.filter$.value;
	}

	// eslint-disable-next-line @typescript-eslint/adjacent-overload-signatures
	set filter(b) {
		this.filter$.next(!this.value);
		this.presentToast(
			this.value ? 'Отображаются проблемные' : 'Отображаются все',
			'bottom'
		);
	}

	destroy() {
		this.filter$.next(null);
		// this.filter$.complete();
	}

	async presentToast(message, position, duration = 1000) {
		const toast = await this.toastCtrl.create({
			message,
			duration,
			position,
			// showCloseButton: true,
			// closeButtonText: window.localStorage.getItem('devicePlatform') == 'iOS' ? 'Обновить' : 'Закрыть'
		});

		await toast.present();
	}



}

import {
	ApplicationRef,
	ComponentFactoryResolver,
	ComponentRef,
	EmbeddedViewRef,
	Inject,
	Injectable,
	Injector,
	Renderer2,
	RendererFactory2,
	Type
} from '@angular/core';
import {DOCUMENT} from '@angular/common';

@Injectable({
	providedIn: 'root',
})
export class DomService {
	/** ref to window document */
	private readonly document: Document;
	/** renderer instance */
	private readonly renderer: Renderer2;
	/** attached component  */
	private componentRef: ComponentRef<unknown>;

	constructor(
		@Inject(DOCUMENT) document,
		private componentFactoryResolver: ComponentFactoryResolver,
		private injector: Injector,
		private applicationRef: ApplicationRef,
		rendererFactory: RendererFactory2
	) {
		this.renderer = rendererFactory.createRenderer(null, null);
		this.document = document;
	}

	attachComponent<T>(component: Type<T>, componentProps: object = null, parent: string): T {
		const componentRef = this.componentFactoryResolver
			.resolveComponentFactory(component)
			.create(this.injector);
		if (componentProps !== null && typeof componentRef.instance === 'object') {
			Object.assign(componentRef.instance, componentProps);
		}
		// put inside the angular component tree
		this.applicationRef.attachView(componentRef.hostView);
		const componentRootNode = (componentRef.hostView as EmbeddedViewRef<unknown>).rootNodes[0] as HTMLElement;
		// append component to the body
		this.renderer.insertBefore(
			document.getElementsByClassName(parent)[0],
			componentRootNode,
			document.getElementsByClassName(parent)[0].lastChild
		);
		this.componentRef = componentRef;
		return componentRef.instance;
	}

	/**
	 * Destroy component
	 */
	removeComponent(): void {
		this.applicationRef.detachView(this.componentRef.hostView);
		this.componentRef.destroy();
	}
}

